description:
TLC's new series &quot;Sisterhood&quot; takes us inside the lives of some of Atlanta's most powerful First Ladies.We'll meet Domonoque, a bold, brash preacher's wife with a past; Ivy, a former member of the girl group Xscape; Christina, a sassy mother of two; Tara, a recent Los Angeles transplant struggling to find her way; and DeLana, a first ladies who's equal parts doting mother and outrageous rock star.

Follow these women as they give us an inside look at what it's like to be a first lady, and the challenges of balancing faith, friendship, family and church. As Domonoque explains, &quot;The only thing we agree on is that we all love God. Everything else is up to chance. (Source: TLC)
